import React from "react";
import EditProfileSideNav from "./EditProfileSideNav";
import './MyPage.css';


function EditProfile({ userName, profileImage }) {
    userName="박범준";
    return(
        <div>
            <div className='container'>
                <EditProfileSideNav userName="박범준" profileImage="img/image.png" />
                <div className="grid-item01">
                    <p className="grid-title">내 프로필</p>
                    <div className="grid-subtitle-image">
                       이미지 <img className="profileImage-edit" src="img/image.png"/>
                    </div>
                    <div className="grid-subtitle">
                        <p>닉네임<span className="nickname">{userName}</span></p>
                        <p>프로필 주소<span className="profile-address">나만의 프로필 주소를 만들어 보세요.</span></p>
                        <p>자기소개<span className="profile-introduce">나만의 스킬, 깃허브 링크 등으로 소개글을 채워보세요.</span></p>
                    </div>
                    <button className="profile-edit-button">설정</button>
                </div>
                <div className="grid-item02"></div>
            </div>
        </div>
    );
}

export default EditProfile;
